import React from "react";
import { slide as Menu } from "react-burger-menu";
import { Link } from "@reach/router";

export default props => {
  return (
    // Pass on our props
    <Menu {...props}>
        <ul>
      <li>
      <Link className="menu-item"  to="/">Gallery</Link></li>
    </ul>
    </Menu>
  );
};
